[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinLabel ?recommendedName
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:recommendedName ?recName .

  ?recName up:fullName ?recommendedName .

  FILTER(CONTAINS(LCASE(?recommendedName), "kinase"))

  OPTIONAL { ?protein rdfs:label ?proteinLabel }
}
LIMIT 100
"}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human membrane transport protein", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "membrane transport", "pageSize": 10}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "calcium ATPase membrane", "limit": 20}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "sodium bile acid cotransporter", "limit": 20}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "phosphate transport mitochondrial", "limit": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?function
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:recommendedName ?recName ;
           up:annotation ?annotation .
  ?recName up:fullName ?proteinName .
  ?annotation a up:Function_Annotation ;
              rdfs:comment ?function .
  FILTER (
    CONTAINS(LCASE(?function), "membrane") && 
    CONTAINS(LCASE(?function), "transport")
  )
}
LIMIT 15"}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "ATP phosphate transport", "limit": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
