PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?protein ?proteinName ?ecName ?catalyticActivity
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:recommendedName ?recName ;
           up:enzyme ?enzyme ;
           up:annotation ?annotation .
  ?recName up:fullName ?proteinName .
  ?enzyme up:activity ?activity ;
          skos:prefLabel ?ecName .
  ?annotation a up:Catalytic_Activity_Annotation ;
              up:catalyticActivity ?catAct .
  ?catAct up:catalyzedReaction ?reaction .
  ?reaction rdfs:label ?catalyticActivity .
  FILTER (
    CONTAINS(LCASE(?proteinName), "membrane") || 
    CONTAINS(LCASE(?proteinName), "transport")
  )
}
LIMIT 20"}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "calcium", "limit": 30}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
